import React, { useState } from "react";
import ReactDOM from "react-dom";

let JWT = null;
function Headlines(props) {
  return (
    <div>
      <h1>{props.number}</h1>
      <Buttons />
    </div>
  );
}

function RegAcc() {
  fetch("https://cab230.hackhouse.sh/register", {
    method: "POST",
    body: "email=n10176250%40qut.edu.au&password=fuckPWD12345~",
    headers: {
      "Content-type": "application/x-www-form-urlencoded"
    }
  })
    .then(function(response) {
      if (response.ok) {
        return response.json();
      }
      throw new Error("Network response was not ok");
    })
    .then(function(result) {
      let queryDiv = document.getElementById("query");
      queryDiv.innerHTML = JSON.stringify(result);
      regButton.disabled = true;
    })
    .catch(function(error) {
      console.log(
        "There has been a problem with your fetch operation: ",
        error.message
      );
    });
}

function LoginAcc() {
  fetch("https://cab230.hackhouse.sh/login", {
    method: "POST",
    body: "email=n10176250%40qut.edu.au&password=fuckPWD12345~",
    headers: {
      "Content-type": "application/x-www-form-urlencoded"
    }
  })
    .then(function(response) {
      if (response.ok) {
        return response.json();
      }
      throw new Error("Network response was not ok.");
    })
    .then(function(result) {
      let queryDiv = document.getElementById("query");
      queryDiv.innerHTML = JSON.stringify(result);
      JWT = result.token;
    })
    .catch(function(error) {
      console.log(
        "There has been a problem with your fetch operation: ",
        error.message
      );
    });
}
const regButton = RegAcc();
const LogonButton = LoginAcc();

function Buttons() {
  const [count, setCount] = useState(0);
  return (
    <div>
      <p>
        <button onClick={LogonButton}>Log in</button>
      </p>
      <p>
        <button onClick={regButton}>Register</button>
      </p>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Headlines number="Criminal Stats Enquiry" />
    </div>
  );
}

const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
